import "bootstrap/dist/css/bootstrap.min.css";
import { Container } from "react-bootstrap";
import Bio from "../../components/Bio/Bio";

function AboutMe() {
  return (
    <Container className="fixedContainer" fluid>
      <div className="row">
        <div className="col-4"></div>
        <div className="col-4">
          <Bio></Bio>
        </div>
        <div className="col-4"></div>
      </div>
    </Container>
  );
}
export default AboutMe;
